const SliderLogo = () => (
    <div className='dots relative mx-auto top-1/2 transform -translate-y-1/2 p-'>
        <Carousel autoplay>
            <div className="inline-block">
                <img src={logo} alt="" className="mx-auto" />
            </div>
            <div className="inline-block">
                <img src={logo} alt="" className="mx-auto" />
            </div>
            <div className="inline-block">
                <img src={logo} alt="" className="mx-auto" />
            </div>
        </Carousel>
    </div>
);

